@Maria Aroca quien es secuestrador????? Gustavo petro, de ser asi porque no lo denuncias penalmente y muestras las pruebas que tengas, o solo es tu opinion, de ser asi, la respeto por que tu opinion es tuya y tienes derecho a ella, ahora, la justicia colombiana no tiene en la fiscalía ninguna demanda acusatoria encontra de petro por eso que tu lo acusas, entonces creeria yo que es algo muy personal tu opinion, porque solo es eso tu opinión, pero mas alla de eso, de un ataque personal infundado en razones que solo tu conoces, no hay nada de verdad, te costa que petro secuestro a alguien, claro que no, lo dices porque fue guerrillero, ahora, yo no acepto a la guerrilla ni comparto nada que tenga que ver con ella, pero si una persona fué guerrillera y se desmovilizo y hace parte de la sociedad civil, como tu o como yo, no veo nada de malo en que participe en política, te pregunto, navarro wolf no fue guerrillero, de hecho del mismo grupo m19, pq no dicen lo mismo, navarro fue constituyente, candidato presidencial, senador, un distinguido político, pero de Navarro no dicen nada, pues yo creo y es mi opinión, que la rabia y la homofobia contra petro no es su vida guerrillera, es su lucha contra la corrupción, es ser una persona que investiga y denuncia con pruebas, como lo ha demostrado en 20 años en el congreso, el haber denunciado a uribe y a sus hijos en dos procesos que afectaron los intereses de ellos, le quito las basuras y ese negocio a los hijos de uribe y lo repartio en familias recicladoras, le acabo el negocio de la chatarrarizacion de vehiculos de donde hay personas presas, 

Ahora sin ser apasionado mira que es mas dañino para ti y tu familia, 
Que se roban 70 mil millones y esta persona esta libre, y el dinero fue entregado dicho por ella publicamente, pero entregado a quienes la pusieron ahi para que robara para ellos, que te parece mejor, los 60 mil asesinatos selectivos de lideres sociales campesinos y hasta canndudatos presidenciales asesinados, el exterminio de la up, la desaparicion del m19, eso para ti esta bien, entonces tines tus manos untadas de sangre y eres igual de criminal que ellos, la masacre de las bananeras te dice algo, la guerra de los mil dia te dice algo, si desconoces eso de nuestra historia te invito respetuosamente que te ilustres, cuando lo hagas de seguro no diras que petro es un secuestrador por haber sido guerrillero, porque nuestro gobierno nuestro estado ha sido mas criminal que la guerrilla en toda su historia, la guerrilla es consecuencia de la violencia y los ultrajes del estado a manos de la  fuerza pública q siempre ha estado de modo servil para proteger los intereses de los ricos y no del pueblo que debe proteger, cuando mas allá de matar, desaparecer o encarcelar personas por ejercer el derecho de pensar diferente, es acabar con las personas comunes en falsos positivos, pero la guerra y la suciedad de sus actos, van mas alla de todo entendimiento, solo queda el dolor, la tristeza la impotencia y la desesperanza, petro es en realidad una posibilidad no factor destructivo, escúchalo pero házlo sin prejuicios, de modo imparcial, sino encuentras nada perfecto sigue con tu criterio, pero dudo mucho q llegues a pensar igual, buenas tardes

